package com.fsoft.fpt.model;

public class ContactAddress {
	private int contactAddressId;
	private String town;
	private String county;
	private String mobileNo;
	private String offficeNo;
	private String faxNo;
	private String address1;
	private String address2;
	private String address3;
	private String city;
	private String state;
	private String country;
	private String postcode;

	/**
	 * 
	 */
	public ContactAddress() {
		super();
		// TODO Auto-generated constructor stub
	}

	public int getContactAddressId() {
		return contactAddressId;
	}

	public void setContactAddressId(int contactAddressId) {
		this.contactAddressId = contactAddressId;
	}

	public String getTown() {
		return town;
	}

	public void setTown(String town) {
		this.town = town;
	}

	public String getCounty() {
		return county;
	}

	public void setCounty(String county) {
		this.county = county;
	}

	public String getMobileNo() {
		return mobileNo;
	}

	public void setMobileNo(String mobileNo) {
		this.mobileNo = mobileNo;
	}

	public String getOffficeNo() {
		return offficeNo;
	}

	public void setOffficeNo(String offficeNo) {
		this.offficeNo = offficeNo;
	}

	public String getFaxNo() {
		return faxNo;
	}

	public void setFaxNo(String faxNo) {
		this.faxNo = faxNo;
	}

	public String getAddress1() {
		return address1;
	}

	public void setAddress1(String address1) {
		this.address1 = address1;
	}

	public String getAddress2() {
		return address2;
	}

	public void setAddress2(String address2) {
		this.address2 = address2;
	}

	public String getAddress3() {
		return address3;
	}

	public void setAddress3(String address3) {
		this.address3 = address3;
	}

	public String getCity() {
		return city;
	}

	public void setCity(String city) {
		this.city = city;
	}

	public String getState() {
		return state;
	}

	public void setState(String state) {
		this.state = state;
	}

	public String getCountry() {
		return country;
	}

	public void setCountry(String country) {
		this.country = country;
	}

	public String getPostcode() {
		return postcode;
	}

	public void setPostcode(String postcode) {
		this.postcode = postcode;
	}

}
